import axios from 'axios'

const api = axios.create({
    baseURL: 'https://127.0.0.1:8000/',
});

export const login = async (usuario: string, password: string) => {
    try {
        const peticion = {
            usuario: usuario,
            password: password,
        };
        console.log(peticion, 'peticion');

        // No necesitas JSON.stringify aquí
        return await api.post('/rest/v1/login', peticion);

    } catch (error) {
        console.log(error);
        throw error;
    }
};
